package org.mingtaoz.leetcode.puzzle;

import static org.truth0.Truth.ASSERT;

import org.junit.Test;

import org.junit.Before;

public class WildcardMatchingTest {

	private WildcardMatching sut;

	@Before
	public void setup() {
		sut = new WildcardMatching();
	}

	@Test
	public void testWildcardMatching8() {
		ASSERT.that(sut.isMatch("hi", "*?")).isTrue();
	}
	
	@Test
	public void testWildcardMatching7() {
		ASSERT.that(sut.isMatch("aa", "*")).isTrue();
	}
	
	@Test
	public void testWildcardMatching6() {
		ASSERT.that(sut.isMatch("b", "*?*?*")).isFalse();
	}

	@Test
	public void testWildcardMatching5() {
		ASSERT.that(
				sut.isMatch(
						"bbbbbabababbbabbbbaaabbbbabbaabbaabbaabaaabaaababbabababaaaaabaabbbabaaabbababbbaababbbbbbaaaaabbabaababbabbbaababbabababbabbbbababbabbbaaabaabbaabbbabaaaabbbaabbbbaaaaaaabbbabbbaabbbbbbbaababaabaabbb",
						"***ba**bbaaa*b***bba*abaa*aaa****b***baababab***ab**ba*b**b**bba*a**b******a******aa**bbb*a**b**b*a*b"))
				.isFalse();
	}

	@Test
	public void testWildcardMatching4() {
		ASSERT.that(sut.isMatch("c", "*?*")).isTrue();
	}

	@Test
	public void testWildcardMatching3() {
		ASSERT.that(sut.isMatch("aa", "a")).isFalse();
	}

	@Test
	public void testWildcardMatching2() {
		ASSERT.that(
				sut.isMatch(
						"",
						"**"))
				.isFalse();
	}

	@Test
	public void testWildcardMatching1() {
		ASSERT.that(
				sut.isMatch(
						"bbbababbbbabbbbababbaaabbaababbbaabbbaaaabbbaaaabb",
						"*b********bb*b*bbbbb*ba")).isFalse();
	}
}
